import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom'

function App() {
  return (
    <>
       <BrowserRouter>
        <Header/>
        <Routes>
            <Route path='/' exact element={<Home/>}/>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
